import React from 'react';
import Cards from './Cards';

function PodcastGallery() {
  const podcasts = [
    {
      videoSrc: '/path/to/podcast1.mp4',
      title: 'Podcast Episode 1',
      keywords: ['technology', 'AI', 'innovation'],
    },
    {
      videoSrc: '/path/to/podcast2.mp4',
      title: 'Podcast Episode 2',
      keywords: ['business', 'startups', 'entrepreneurship'],
    },
    // Add more podcasts as needed
  ];

  return (
    <div>
      <Cards podcasts={podcasts} />
    </div>
  );
}

export default PodcastGallery;
